import React from "react";
import axios from "axios";

export default async function add(something) {
  const url = "https://cubioinfo.com/aptitude-test/api/answersheets/1";

  try {
    console.log("try to fetch");
    console.log("json post:", JSON.stringify(something));
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json");

    var raw = JSON.stringify({
      TestId: 1,
      Tit: "ad",
      Fname: "das",
      Lname: "ad",
      CitzId: "1102200162577",
      Age: 11,
      Gndr: false,
      EduId: 36,
      BrId: 9,
      D1x1: 4,
      D1x2: 4,
      D1x3: 4,
      D1x4: 4,
      D1x5: 4,
      D1x6: 4,
      D1x7: 4,
      D1x8: 4,
      D1x9: 4,
      D2x1: 4,
      D2x2: 4,
      D2x3: 4,
      D2x4: 4,
      D2x5: 4,
      D2x6: 4,
      D2x7: 4,
      D2x8: 4,
      D2x9: 4,
      D1r1: 0.28,
      D1r2: 0.148,
      D1r3: -0.137,
      D1r4: 0.192,
      D1r5: -0.144,
      D1r6: -0.134,
      D1r7: -0.135,
      D1r8: 0.081,
      D1r9: -0.317,
      D1r10: 0.076,
      D1r11: -0.005,
      D1r12: 0.287,
      D1r13: 0.322,
      D1r14: 0.282,
      D1r15: 0.295,
      D1r16: 0.13,
      D1r17: -0.535,
      D1r18: 0.295,
      D2r1: 0.082,
      D2r2: 0.171,
      D2r3: -0.062,
      D2r4: -0.053,
      D2r5: -0.083,
      D2r6: -0.019,
      D2r7: 0.001,
      D2r8: 0.018,
      D2r9: -0.106,
      D2r10: 0.116,
      D2r11: -0.057,
      D2r12: 0.039,
      D2r13: -0.045,
      D2r14: 0.096,
      D2r15: 0.121,
      D2r16: 0.03,
      D2r17: -0.181,
      D2r18: 0.069,
      Ans:
        "444444444444444444444444444444444444444444444444444444444444444444444444444444444444444",
      Avg1: 0.181,
      Avg2: 0.16,
      Avg3: -0.099,
      Avg4: 0.07,
      Avg5: -0.114,
      Avg6: -0.076,
      Avg7: -0.067,
      Avg8: 0.05,
      Avg9: -0.211,
      Avg10: 0.096,
      Avg11: -0.031,
      Avg12: 0.163,
      Avg13: 0.138,
      Avg14: 0.189,
      Avg15: 0.208,
      Avg16: 0.08,
      Avg17: -0.358,
      Avg18: 0.182,
    });

    var requestOptions = {
      method: "POST",
      headers: myHeaders,
      body: raw,
      redirect: "follow",
    };

    const response = await fetch(
      "https://cubioinfo.com/aptitude-test/api/answersheets/1",
      requestOptions
    )
      .then((response) => response.text())
      .then((result) => console.log(result))
      .catch((error) => console.log("error", error));

    if (response.ok) {
      return await response.json();

      // return await response.json();
    }
    if (response.status <= 501) {
      console.log(response.status);
      // alert(
      //    "เกิดปัญหา" +
      //     response.status +
      //      "\n คลิก close  เพื่อเริ่มทำแบบทดสอบใหม่อีกครั้ง"
      //  );
      //  window.location.href = `${process.env.PUBLIC_URL}`;
      return response.status;

      // eslint-disable-next-line prefer-promise-reject-errors
    }
  } catch (error) {
    if (error.response) {
      /*
       * The request was made and the server responded with a
       * status code that falls out of the range of 2xx
       */
      return error.response.status;
      //console.log(error.response.data);
      //console.log(error.response.status);
    } else if (error.request) {
      /*
       * The request was made but no response was received, `error.request`
       * is an instance of XMLHttpRequest in the browser and an instance
       * of http.ClientRequest in Node.js
       */
      return error.request;
    } else {
      // Something happened in setting up the request and triggered an Error
      return 999;
    }
  }
}
